import React, { Component } from 'react';

class Authors extends Component {
  constructor(props) {
    super(props);

    this.state = {
      fav: false
    };
  }

  render() {
    const { author } = this.props;

    return <React.Fragment>{author.name}</React.Fragment>;
  }
}
export default Authors;
